import React from 'react' ;
import './Contact.css' ;

function Contact()  {

    return(
      <div className="contact-us">
        <form>
           <textarea name="message" rows="10" cols="60">
              Enter your message
           </textarea>
        </form>
         
        
      
          
      </div>
     
    );
}
  
  export default Contact ;
